【秋プラス春ウコンの詳細】<br>
●本品は、5粒中にウコンエキス末85mg（ウコン原末2236mg相当）、秋ウコン末437.5mg、春ウコン末62.5mg、合計2736mg相当のウコン成分を配合しております。<br>
●クルクミノイドは80mg含まれています。<br><br>

【お召し上がり方】<br>
1日4-5粒を目安に、水又はぬるま湯と共にお召し上がりください。<br><br>

【ご注意】<br>
○開封後はなるべくお早めにお召し上がりください。<br>
○日光の当たる所や湿度の高い所で保存されますと、変質や変色を起こす恐れがあります。<br>
○体調に合わないと思われる時は、すぐに摂取をお止めください。<br>
○アレルギーをお持ちの方は原材料名表記を必ずご確認ください。<br>
○乳幼児の手の届かない所に保管してください。<br>
○本品は多量摂取により疾病が治癒したり、より健康が増進するものではありません。1日の摂取目安量を守ってください。<br>
○亜鉛の摂りすぎは、銅の吸収を阻害するおそれがありますので過剰摂取にならないよう注意してください。<br>
○妊娠中、授乳中の方は医師に相談の上、お召し上がりください。<br>
○薬を服用中の方、疾病等をお持ちの方、通院中の方は医師に相談の上、お召し上がりください。<br>
○本品は、特定保健用食品と異なり、消費者庁長官による個別審査を受けたものではありません。<br><br>

【原材料】<br>
秋ウコン粉末、マルチトール、ウコン抽出物、春ウコン粉末、コーンスターチ、セルロース、ステアリン酸カルシウム、微粒二酸化ケイ素<br><br>

【栄養成分】5粒(1250mg)当たり<br>
熱量：4.73kcaL、タンパク質：0.04g、脂質：0.02g、炭水化物：1.08g、ナトリウム：0.24mg、秋ウコン末：437.5mg、春ウコン末：62.5mg、ウコンエキス末：85mg(原末換算2236mg相当)、クルクミノイド：80mg<br><br>

【賞味期限】<br>
パッケージに記載<br><br>

【内容量】<br>
400粒<br><br>

【販売元】<br>
ユーワ<br>
東京都東大和市中央3-890-1ﾕｰﾜﾋﾞﾙ<br>
お電話：042-561-0091<br><br>

【商品区分】<br>
食品<br><br>

[ウコン サプリメント　うこん サプリメント] 

